import React from 'react';
import styled from 'styled-components';

// Image data for services
const servicesData = [
  { id: 1, img: 'back-pain.jpg', title: 'Back Pain Treatment' },
  { id: 2, img: 'wrist-joint-pain.jpg', title: 'Joint Pain Treatment' },
  { id: 3, img: 'slipped-disc.jpg', title: 'Slipped Disc Treatment' },
  { id: 4, img: 'neck-pain.jpg', title: 'Neck Pain Treatment' },
  { id: 5, img: 'ankle-joint-pain.png', title: 'Joint Pain Treatment' },
  { id: 6, img: 'headache.jpg', title: 'Headache Treatment' },
  { id: 7, img: 'knee-pain.jpg', title: 'Knee Pain Treatment' },
  { id: 8, img: 'sport-injuries.jpg', title: 'Sports Injuries Treatment' }
];

// Image data for patient resources
const resourcesData = [
  { 
    id: 1, 
    type: 'testimonial',
    img: 'patient.png',
    content: '"Dr. Rajeev Menon is truly a great doctor. He has lots of experience and his approach is very friendly."',
    author: '- Priya Mehta',
    buttonText: 'Read More'
  },
  { 
    id: 2, 
    type: 'faq',
    title: 'Frequently Asked Questions',
    items: [
      'How can I get my prescription?',
      'What should I bring to my appointment?',
      'What should I expect during my first checkup?'
    ],
    buttonText: 'View all'
  },
  { 
    id: 3, 
    type: 'calendar',
    title: 'Schedule an Appointment',
    img: 'may-calendar.png'
  },
  { 
    id: 4, 
    type: 'blog',
    title: 'Blog',
    img: 'stethoscope.png',
    content: 'Understanding Chronic Pain',
    buttonText: 'Read more'
  }
];

const App = () => {
  return (
    <GlobalStyles>
      <div className="App">
        <Header>
          <div className="logo">
            <img src="logo.png" alt="RelivaWell logo" className="logo-img"/>
            <span className="reliva">RelivaWell</span>
          </div>
          <nav>
            <a href="#">Home</a>
            <a href="#">About the Doctor</a>
            <a href="#">Services</a>
            <a href="#">Patient Resources</a>
            <a href="#">Contact</a>
