          <div className="nav-buttons">
            <button className="login">Log In</button>
            <button className="signup">Sign Up</button>
          </div>
        </Header>

        <Main>
          <HeroSection>
            <HeroContent>
              <h1><span>Stop</span><strong> Guessing.</strong><BlueText> Start </BlueText><strong>Healing.</strong></h1>
              <p>Personalised, compassionate care for chronic pain and fibromyalgia, and unexplained symptoms.</p>
