            </HeroContent>
            <HeroImage src="doctor.jpg" alt="Doctor consulting patient"/>
          </HeroSection>

          <DoctorSection>
            <DoctorContainer>
              <DoctorImage src="medical.png" alt="Dr. Rajeev Menon"/>
