                <h3>Orthopaedic Surgery & Joint Pain</h3>
                <h5>🎓 MBBS MS(Orthopedics)</h5>
                <h5>⌛ 13 years experience</h5>
                <p>He treats whole body pain by finding and healing the root cause. With years of experience in pain medicine, he helps patients get relief.</p>
