                <FormInput type="tel" placeholder="Contact"/>
                <FormTextarea placeholder="Message"/>
                <PrimaryButton>Send</PrimaryButton>
              </FormBox>

              <FormBox>
                <h3>Booking Appointment</h3>
                <FormInput type="date"/>
                <FormInput type="time"/>
                <FormInput type="text" placeholder="Reason for Visit"/>
                <PrimaryButton>Book Appointment</PrimaryButton>
              </FormBox>

              <FormBox>
                <h3>Map & Directions</h3>
                <FormInput type="text" placeholder="Enter Location"/>
                <label>Zoom Level</label>
                <FormRangeInput type="range" min="1" max="20" defaultValue="10"/>
                <MapImage src="map.jpg" alt="Clinic location map"/>
              </FormBox>
            </FormGrid>
          </PatientResourcesSection>
        </Main>

        <Footer>
          <FooterColumn>
            <h3>Contact With Us</h3>
            <p>info@relivawell.com</p>
            <p>+91 98765 43210</p>
          </FooterColumn>

          <FooterColumn>
            <h3>Quick Links</h3>
            <FooterLink href="#">Conditions</FooterLink>
            <FooterLink href="#">Treatments</FooterLink>
            <FooterLink href="#">Appointment</FooterLink>
          </FooterColumn>

          <FooterColumn>
            <h3>🕥 Clinic Hours</h3>
